import {
  HeightAndWidth, Windows, Doors, NextButton,
} from './index';

function FirstForms() {
  return (
    <form>
      <HeightAndWidth />
      <Windows />
      <Doors />
      <NextButton />
    </form>
  );
}

export default FirstForms;
